\u0412\u043e\u043f\u0440\u043e\u0441 64.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
В Акапулько и Лас-Вегасе есть возможность быстро зарегистрировать брак;
чем успешнее, спокойнее и быстрее прошел развод, тем лучше будет новый
брак (по приведенному мнению статистики).

\u0412\u043e\u043f\u0440\u043e\u0441 161.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Учитывая традиционные возлияния, которые в фольклоре связаны с рыбалкой;
юмористы утверждают, что к концу рыбалки рыбак рыбака уже не видит
издалека.
